import React from 'react';
import './styles.css';

export default function About() {
    return (
        <div className="Body">
            <h1>ABOUT</h1>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-sm">
                        <img className="img-fluid rounded mx-auto d-block" src={require("../assets/headshot.jpg")} alt="Headshot"></img>
                    </div>
                    <div className="col-sm"></div>
                </div>
            </div>
            <p>A passionated developer that aims to make beautiful yet usefull products. I'm quietly confident, naturally curious, and perpetually working on improving my chops one design problem at a time.</p>
        </div>
    );
}
